    [],nt"revision_timestamp": "2015-11-20T22:40:14.711863",nt"name": "locations-of-combined-sewer-overflow-outfalls",nt"isopen":
    false,nt"url": null,nt"notes": "This data layer identifies the locations
    of Combined sewer overflow outfalls. Combined sewer systems are sewers that are
    designed to collect rainwater runoff, domestic sewage, and industrial wastewater
    in the same pipe. Most of the time, combined sewer systems transport all of their
    wastewater to a sewage treatment plant, where it is treated and then discharged
    to a water body. During periods of heavy rainfall or snowmelt, however, the wastewater
    volume in a combined sewer system can exceed the capacity of the sewer system or
    treatment plant. For this reason, combined sewer systems are designed to overflow
    occasionally and discharge excess untreated wastewater directly to nearby streams,
    rivers, or other water bodies. For further information visit: http://cfpub1.epa.gov/npdes/home.cfm?program_id=5",nt"license_title":
